$_MODULE['<{add_faktura}prestashop>admin_main_756c47b54a108dede7707291411fd314'] = '3. V prípade kúpy 6-10 licencií od jedného produktu je Kupujúcemu poskytnutá zľava 20% z celkovej sumy za tento produkt. Kupujúci smie použiť počet zakúpených licencií na rovnakom počte webov / e-shopov v produkčnom režime, nie vyšším ako je zakúpený počet licencií. Kupujúci je povinný oznámiť Dodávateľovi, na akých doménach, akých weboch,budú zakúpené licencie použité.';
$_MODULE['<{add_faktura}prestashop>admin_main_b37ffc61702b734fb87923ed5ceac02d'] = '4. V prípade kúpy Multilicencie je cena takejto licencie desaťnásobok ceny jednej licencie zakúpeného produktu. Nákupom Multilicencie Kupujúci smie používať zakúpený produkt v neobmedzenom počte na všetkých svojich weboch / e-shopoch v produkčnom režime.';
