$_MODULE['<{add_faktura}prestashop>admin_main_a7281e4b682027769b44d87c626518e2'] = 'sprostredkovávať, ponúkať a predávať zakúpené produkty verejne alebo individuálne tretím stranám';
$_MODULE['<{add_faktura}prestashop>admin_main_2e0e127ee2f517839afcbc1c4651a2e1'] = 'rozmnožovať, vytvárať kópie zakúpených produktov.';
$_MODULE['<{add_faktura}prestashop>admin_main_4f91db3feda8b180c5783b158457051a'] = '8. Dodávateľ nezodpovedá za funkčnosť alebo kompatibilitu bezplatne ponúkaných modulov a zodpovednosť za ich používanie. Akékoľvek vzniknuté škody či prípadnú stratu a poškodenie dát, nesie výhradne Kupujúci. K bezplatne ponúkaným modulom Dodávateľ nezabezpečuje žiadne bezplatné poradenstvo ani individuálne modifikácie. Bezplatné moduly Kupujúci môže:';
$_MODULE['<{add_faktura}prestashop>admin_main_ef5213ddd7fae83a592ca8ca8c46bb1c'] = 'používať akokoľvek a kdekoľvek';
$_MODULE['<{add_faktura}prestashop>admin_main_037b91bd391f2263614f82939c41bc74'] = 'vykonávať modifikácie funkčnosti a vzhľadu';
$_MODULE['<{add_faktura}prestashop>admin_main_f24961facebd64dd0f3df3e8a4847963'] = 'ponúkať ich tretím stranám';
$_MODULE['<{add_faktura}prestashop>admin_main_9b06af6e0f1d4d240f4ab9df7f037f41'] = '9. Kupujúci nie je oprávnený predávať tretím stranám akékoľvek Dodávateľom spoplatnené služby, moduly alebo webové stránky. Zaplatením služieb, produktov a web stránky prechádzajú majetkové práva z Dodávateľa na Kupujúceho. Dodávateľ si vyhradzuje autorské právo na zhotovené grafické a programátorské práce, ako aj na jednotlivé designy, moduly a úpravy.';
$_MODULE['<{add_faktura}prestashop>admin_main_9dd19f5a41f1332c02c5516d0f5b02ba'] = '10. Kupujúci berie na vedomie, že ponúkané spoplatnené produkty sú chránené autorským zákonom, zabezpečené proti kopírovaniu a šíreniu a zaväzuje sa, že produkty nebude rozmnožovať, kopírovať, nezneužije ich a nebude ich poskytovať ďalej, šíriť ani realizovať také kroky, ktoré by mali za cieľ narušiť ochranu poskytovaných produktov. Kupujúci je zodpovedný za škodu, ktorá takýmto jeho správaním môže vzniknúť.';
$_MODULE['<{add_faktura}prestashop>admin_main_5730aca3456a19cc3e89ce9ee0af6c35'] = '11. Kupujúci sa zaväzuje, že sa nebude snažiť prelomiť ochranu autorských práv a ďalšie predpisy, ktorými sa riadi ochrana duševného vlastníctva.';
$_MODULE['<{add_faktura}prestashop>admin_main_cb64f400d09c10f488149452b4d10ad2'] = '12. Download softvér je povolený iba z presta-modul.shopmk.cz alebo zo súboru zaslaného Dodávateľom na e-mailovú adresu Kupujúceho. Používaním tohto softvéru znamená, že Kupujúci súhlasí s vyššie uvedenými autorskými právami.';
$_MODULE['<{add_faktura}prestashop>admin_main_3e686ff1c164a515748964106487e83b'] = '13. Kupujúci prehlasuje, že Dodávateľ nenesie právnu zodpovednosť za škody spôsobené v súlade s užívaním voči objednávateľovi ani tretím stranám, a že akékoľvek vzniknuté škody či prípadnú stratu a poškodenie dát nesprávnym nastavením, používaním produktu či prípadnými úpravami produktu Kupujúcim, nesie výhradne Kupujúci.';
$_MODULE['<{add_faktura}prestashop>admin_main_5c5d045b131891b94a5fbb40070ca446'] = 'PREDAJ A DISTRIBÚCIA JE ZAKÁZANÁ!';
$_MODULE['<{add_faktura}prestashop>admin_main_5dd5f10920a7fe8d601e08560c674464'] = 'Download softvér je povolený len z';
$_MODULE['<{add_faktura}prestashop>admin_main_e71406c944afa8ef351714f3e05eeea8'] = 'alebo zo súboru zaslaného Dodávateľom na e-mailovú adresu Kupujúceho. ';
$_MODULE['<{add_faktura}prestashop>admin_main_9ccdc101a3218c2858dd5381ba138875'] = 'Používaním tohto softvéru znamená, že Kupujúci súhlasí s vyššie uvedenými autorskými právami.';
$_MODULE['<{add_faktura}prestashop>admin_main_14ec67bd416bcbe3a2ad93246dcc05cb'] = 'Kupujúci prehlasuje, že Dodávateľ nenesie právnu zodpovednosť za škody ';
$_MODULE['<{add_faktura}prestashop>admin_main_a928b7a9dc8233d58ebacf44eaeb9cda'] = 'spôsobené v súlade s užívaním voči objednávateľovi ani tretím stranám, ';
$_MODULE['<{add_faktura}prestashop>admin_main_42a1157b447865a77b786ea3e1e5d31f'] = 'a že akékoľvek vzniknuté škody či prípadnú stratu a poškodenie dát nesprávnym nastavením,';
$_MODULE['<{add_faktura}prestashop>admin_main_927a0d6a3af7d4d91dd6b01ab3f4ae8d'] = 'používaním produktu či prípadnými úpravami produktu Kupujúcim,';
$_MODULE['<{add_faktura}prestashop>admin_main_7d16d80b8fd3be9ab64091e0d57dd735'] = 'nesie výhradne Kupujúci.';
